import React from "react";

const Link = ({ level, index, data, handleInputChange, removeLink }) => {
    return (
        <div className="border p-3 mb-3">
            <div className="mb-2">
                <label>Title:</label>
                <input
                    type="text"
                    className="form-control"
                    value={data.title}
                    onChange={(e) => handleInputChange(level, index, "title", e.target.value)}
                />
            </div>
            <div className="mb-2">
                <label>Link:</label>
                <input
                    type="text"
                    className="form-control"
                    value={data.link}
                    onChange={(e) => handleInputChange(level, index, "link", e.target.value)}
                />
            </div>
            <div className="mb-2">
                <label>Description:</label>
                <textarea
                    className="form-control"
                    value={data.description}
                    onChange={(e) => handleInputChange(level, index, "description", e.target.value)}
                />
            </div>
            <div className="mb-2">
                <label>Rating:</label>
                <input
                    type="number"
                    className="form-control"
                    value={data.rating}
                    onChange={(e) => handleInputChange(level, index, "rating", e.target.value)}
                />
            </div>
            <button type="button" className="btn btn-danger" onClick={() => removeLink(level, index)}>
                Remove
            </button>
        </div>
    );
};

export default Link;
